import { Card, Container } from '@material-ui/core';
import React, { useState } from 'react';
import Page from '../Page';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
function createData(
    name,
    calories,
    fat,
    carbs,
    protein,
  ) {
    return { name, calories, fat, carbs, protein };
  }
  const rows = [
    createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
    createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
    createData('Eclair', 262, 16.0, 24, 6.0),
    createData('Cupcake', 305, 3.7, 67, 4.3),
    createData('Gingerbread', 356, 16.0, 49, 3.9), 
  ];

  var  tmp;
  const API_KEY = "?api_key=" + "RGAPI-6a96a8f8-d021-4f81-8828-898ab358a5fd";
  const players = ["Anxhanna"];


  function getResult(player){
    const [state, setState] = useState();
    const APICall = "https://euw1.api.riotgames.com/lol/summoner/v4/summoners/by-name/" + player + API_KEY;
    var tmp;
    fetch(APICall).then((response) => {
        console.log(response);
        return response.json();

    }) .then((result) => {
        console.log('res', result)
        this.setState({ summoner_id: result.id});
    });
  }



  async function getPlayerDatas(player) {
    var APICall = "https://euw1.api.riotgames.com/lol/league/v4/entries/by-summoner/" + player + API_KEY;
    axios.get(APICall).then(function (r) {
        return r;

        }).catch (function(e) {
            console.log(e);
        })
  }


export default class Home extends React.Component {

    constructor(props) {
        super(props);
        this.state= {
            name: "",
            post: {},
            summoner_infos: [{},{}],
            summoner_id: '',
            summoner_account_id: '',
            status: 0,
            error_message: null,
            body: null,
            icon_url: ''
        };
        this.summoners= {
            players:{}
        };
    }

    render() {
      /*  for (var i = 0; i < players.length; i++) {
            this.player.name = players[i];
            var tmp = searchPlayer(players[i]);

            console.log("test  " + players[i] + "  "+  tmp);
            //this.player.summoner_id = tmp.id;
            //this.summoner_account_id= tmp.accountId;
            //tmp = getPlayerDatas(tmp);
            console.log(tmp);
        }*/
        const { name, summoner_infos, icon_url, error_message, body } = this.state;
    return (
        <Page title="Ranking">
                <Container>
                    {getResult(players[0])}
                    <TableContainer component={Paper} >
      <Table sx={{ minWidth: 650 ,bgcolor: '#2F4F4F'}} aria-label="simple table">
        <TableHead>
          <TableRow >
            <TableCell sx={{ color: 'white'}}>Player</TableCell>
            <TableCell sx={{ color: 'white'}} align="right">Summoner Name</TableCell>
            <TableCell sx={{ color: 'white'}} align="right">Rank</TableCell>
            <TableCell sx={{ color: 'white'}} align="right">W</TableCell>
            <TableCell sx={{ color: 'white'}} align="right">L</TableCell>
            <TableCell sx={{ color: 'white'}} align="right">WR</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow
              key={row.name}
              sx={{ 'td, th': { border: 0, color: 'white' } }}
            >
              <TableCell component="th" scope="row">
                {row.name}
              </TableCell>
              <TableCell align="right">{row.calories}</TableCell>
              <TableCell align="right">{row.fat}</TableCell>
              <TableCell align="right">{row.carbs}</TableCell>
              <TableCell align="right">{row.protein}</TableCell>
            </TableRow>

          ))}
        </TableBody>
      </Table>
    </TableContainer>

                </Container>
        </Page>
    )
}
}
